import {View, Image, StyleSheet, Pressable } from "react-native";

const Navbar = () => {
  return (
    <View style={styles.navbarMain}>
      <View style={styles.navbarContainer}>
        <Pressable onPress={(e)=>console.log(e.target.context)} style={styles.navbarIcon} android_ripple={{borderless:true,radius:40}}>
          <Image style={styles.navbarIconImage} source={require("../../assets/images/list.png")} />
        </Pressable>
        <Pressable style={styles.navbarIcon} android_ripple={{borderless:true,radius:40}}>
          <Image style={styles.navbarIconImage} source={require("../../assets/images/home.png")} />
        </Pressable>
        <Pressable style={styles.navbarIcon} android_ripple={{borderless:true,radius:40}}>
          <Image style={styles.navbarIconImage} source={require("../../assets/images/plus.png")} />
        </Pressable>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  navbarMain: {
    position: "absolute",
    alignItems: "center",
    bottom: 20,
  },
  navbarContainer: {
    flexDirection: "row",
    backgroundColor: "#F0FFFF",
    width: "85%",
    justifyContent: "space-between",
    borderWidth:1,
    borderColor:'#A9A9A9',
    borderRadius:20
  },
  navbarIcon:{
    padding:5,
  },
  navbarIconImage:{
   width:32,
   height:32
  }
});

export default Navbar;
